webstoreListingDescription.message:
Pasang sambungan AudD dan klik pada ikonnya untuk mengenal pasti lagu yang dimainkan pada tab semasa.
Tonton video di atas untuk melihat cara ia berfungsi.

Sambungan AudD:
- Mengecam muzik yang dimainkan dalam penyemak imbas anda;
- Mencari muzik dalam pangkalan data AudD dengan lebih daripada 75 juta lagu menggunakan teknologi pengecaman muziknya;
- Menunjukkan lirik untuk lagu yang dikenal pasti;
- Menunjukkan pautan untuk mendengar lagu di Apple Music, Spotify, Deezer, YouTube Music;
- Memaparkan detik yang tepat dalam lagu yang diiktiraf apabila bunyi dari pelayar dimainkan.

API Pengecaman Muzik: https://audd.io
Kod sumber: https://github.com/AudDMusic/chrome-extension

